  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Benton
  Lake National Wildlife Refuge outlines Refuge accomplishments during the 1974 fiscal
  year.  The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, predators, rodents, mammals,
  and diseases- is also covered. The Refuge development and maintenance section discusses
  physical developments and plantings. Resource management is outlined; topics include
  grazing. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses,
  Refuge visitors, hunting, violations, and safety. Items of interest and N-R forms
  are attached\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
